// App.tsx
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import FundSubscription from './components/FundSubscription/FundSubscription';
import FundCancellation from './components/FundCancellation/FundCancellation';
import TransactionHistory from './components/TransactionHistory/TransactionHistory';
import Notification from './components/Notification/Notification';
import Dashboard from './components/Dasnoard/Dashboard';
import './App.styles.css';

/**
 * Componente principal de la aplicaci贸n.
 * Incluye la estructura de navegaci贸n del dashboard administrativo.
 */
const App: React.FC = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Dashboard />}>
          <Route path="fund-subscription" element={<FundSubscription />} />
          <Route path="fund-cancellation" element={<FundCancellation />} />
          <Route path="transaction-history" element={<TransactionHistory />} />
          <Route path="notification" element={<Notification message="Welcome to the Fund Management System!" type="success" />} />
        </Route>
      </Routes>
    </Router>
  );
};

export default App;
